  name: TreeViewImageSet
  nameWithType: TreeViewImageSet
  fullName: System.Web.UI.WebControls.TreeViewImageSet
  type: Enum
  assemblies:
  - System.Web
  namespace: System.Web.UI.WebControls
  summary: Represents an image set to use in the <xref href="System.Web.UI.WebControls.TreeView"></xref> control.
  remarks: "The <xref:System.Web.UI.WebControls.TreeViewImageSet> enumeration is used to represent the different sets of images that can be displayed in the <xref:System.Web.UI.WebControls.TreeView> control. You can select from a predefined set of images or create your own custom set by setting the <xref:System.Web.UI.WebControls.TreeView.ImageSet%2A> property to the Custom value. When defining a custom set of images, you should specify an image for each of the properties in the following table. Otherwise, the default image for that property is used.  \n  \n|Property|Description|  \n|--------------|-----------------|  \n|<xref:System.Web.UI.WebControls.TreeView.CollapseImageUrl%2A>|The URL to a custom image for the collapsed node indicator.|  \n|<xref:System.Web.UI.WebControls.TreeView.ExpandImageUrl%2A>|The URL to a custom image for the expanded node indicator.|  \n|<xref:System.Web.UI.WebControls.TreeView.LineImagesFolder%2A>|The URL to a folder that contains custom images for lines-connecting nodes.|  \n|<xref:System.Web.UI.WebControls.TreeView.NoExpandImageUrl%2A>|The URL to a custom image for the non-expanding node indicator.|"
  example:
  - "The following code example demonstrates how to use the <xref:System.Web.UI.WebControls.TreeViewImageSet> enumeration to indicate which image set to use in the <xref:System.Web.UI.WebControls.TreeViewImageSet> control.  \n  \n <!-- TODO: review snippet reference [!code-csharp[TreeViewImageSet#1](~/samples/snippets/csharp/VS_Snippets_WebNet/TreeViewImageSet/CS/treeviewimagesetcs.aspx#1)]  -->\n <!-- TODO: review snippet reference [!code-vb[TreeViewImageSet#1](~/samples/snippets/visualbasic/VS_Snippets_WebNet/TreeViewImageSet/VB/treeviewimagesetvb.aspx#1)]  -->"
